    false,nt"url": null,nt"notes": "n               The Topological Faces /
    Area Landmark Relationship File (FACESAL.dbf) contains a record for each face /
    area landmark relationship.  Face refers to the areal (polygon) topological primitives
    thatn               make up MTDB.  A face is bounded by one or more edges; its boundary
    includes only the edges that separate it from other faces, not any interior edges
    contained within the area of the face.  The facen               to which a record
    in the Topological Faces / Area Landmark Relationship File (FACESAL.dbf) applies
    can be determined by linking to the Topological Faces Shapefile (FACES.shp) on the
    permanentn               topological face identifier (TFID) attribute.  The area
    landmark to which a record in the Topological Faces / Area Landmark Relationship
    File (FACESAL.dbf) applies can be determined by linking to then               Area
    Landmark Shapefile (AREALM.shp) on the area landmark identifier (AREAID) attribute.
     A face may be part of multiple area landmarks.  An area landmark may consist of
    multiple faces.n               n               The TIGER/Line shapefiles and related
    database files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address File / n               Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB represents a seamless national file with no overlaps or gaps between parts,
    however, eachn               TIGER/Line shapefile is designed to stand alone as
    an independent data set, or they can be combined to cover the entire nation.n            ",nt"license_title":
